--
-- Name: cleanup_live_flights(); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.cleanup_live_flights() RETURNS void
    LANGUAGE plpgsql
    AS $$
BEGIN
    DELETE FROM flights
    WHERE source = 'live' 
    AND created_at < (NOW() - INTERVAL '48 hours');
    -- All associated live_track_points will be automatically deleted due to CASCADE
END;
$$;


--
-- Name: generate_live_track_linestring(uuid); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.generate_live_track_linestring(flight_uuid uuid) RETURNS public.geometry
    LANGUAGE plpgsql
    AS $_$
BEGIN
    RETURN ST_MakeLine(
        ARRAY(
            SELECT geom 
            FROM live_track_points AS ltp
            WHERE ltp.flight_uuid = $1  -- Use positional parameter instead of name
            ORDER BY datetime ASC
        )
    );
END;
$_$;


--
-- Name: generate_scoring_track_linestring(uuid); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.generate_scoring_track_linestring(flight_uuid uuid) RETURNS public.geometry
    LANGUAGE plpgsql
    AS $_$BEGIN
    RETURN ST_MakeLine(
        ARRAY(
            SELECT geom 
            FROM scoring_tracks AS stck
            WHERE stck.flight_uuid = $1
			ORDER BY date_time ASC
        )
    );
END;$_$;


--
-- Name: generate_uploaded_track_linestring(uuid); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.generate_uploaded_track_linestring(flight_uuid uuid) RETURNS public.geometry
    LANGUAGE plpgsql
    AS $_$
BEGIN
    RETURN ST_MakeLine(
        ARRAY(
            SELECT geom 
            FROM uploaded_track_points AS utp
            WHERE utp.flight_uuid = $1  -- Use positional parameter instead of name
            ORDER BY datetime ASC
        )
    );
END;
$_$;


--
-- Name: update_flymaster_track_point_geom(); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.update_flymaster_track_point_geom() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
    BEGIN
        IF NEW.geom IS NULL OR ST_IsEmpty(NEW.geom) THEN
            NEW.geom = ST_SetSRID(ST_MakePoint(NEW.lon, NEW.lat), 4326);
        END IF;
        RETURN NEW;
    END;
$$;


--
-- Name: update_live_track_point_geom(); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.update_live_track_point_geom() RETURNS trigger
    LANGUAGE plpgsql
