    $$;


--
-- Name: update_scoring_tracks_geom(); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.update_scoring_tracks_geom() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
BEGIN
    -- Update the geom column using the lat and lon columns
    NEW.geom = ST_SetSRID(ST_MakePoint(NEW.lon, NEW.lat), 4326);
    RETURN NEW;
END;
$$;


--
-- Name: update_uploaded_track_point_geom(); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.update_uploaded_track_point_geom() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
    BEGIN
        IF NEW.geom IS NULL OR ST_IsEmpty(NEW.geom) THEN
            NEW.geom = ST_SetSRID(ST_MakePoint(NEW.lon, NEW.lat), 4326);
        END IF;
        RETURN NEW;
    END;
    $$;


