-- Name: flights; Type: TABLE; Schema: public; Owner: -
--

CREATE TABLE public.flights (
    id uuid NOT NULL,
    flight_id character varying NOT NULL,
    race_uuid uuid NOT NULL,
    race_id character varying NOT NULL,
    pilot_id character varying NOT NULL,
    pilot_name character varying NOT NULL,
    created_at timestamp with time zone NOT NULL,
    source character varying NOT NULL,
    first_fix json,
    last_fix json,
    total_points integer,
    device_id character varying,
    flight_state json
);


--
-- Name: flight_linestrings; Type: VIEW; Schema: public; Owner: -
--

CREATE VIEW public.flight_linestrings AS
 SELECT f.id AS flight_uuid,
    f.flight_id,
    f.race_id,
    f.pilot_id,
    f.pilot_name,
    f.source,
        CASE
            WHEN ((f.source)::text = 'live'::text) THEN public.generate_live_track_linestring(f.id)
            WHEN ((f.source)::text = 'upload'::text) THEN public.generate_uploaded_track_linestring(f.id)
            ELSE NULL::public.geometry
        END AS linestring_geom,
    f.first_fix,
    f.last_fix,
    f.total_points
   FROM public.flights f;


